const Button = ({ backgroundColor, text }) => {
  return (
    <button style={{ backgroundColor: backgroundColor }} className="btn">
      {text}
    </button>
  );
};

Button.defaultProps = {
  backgroundColor: "green",
};

Button.propTypes = {
  backgroundColor: PropTypes.string.isRequired,
};

export default Button;
